import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import { Nav, Navbar } from 'react-bootstrap';


function App() {
  return (
    <div className="App">
      <Navbar bg="dark">
        <Navbar.Brand>
          Logo
        </Navbar.Brand>
      <Nav>
        <Nav.Link href="About"> About</Nav.Link>
      </Nav>
      </Navbar>
    </div>
  );
}

export default App;
